import React from 'react'

const Header = () => {
    return (
        <div style={stylesHeader.container}>
            This is Header!
        </div>
    )
}

export default Header


const stylesHeader = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: 'red',
        alignItems: 'center',
        justifyContent: 'center',
    },
});
